import React from "react";

const log = ()=>{

    return(
        <div className = "logDetails">
            <table style={{    justifyContent: "space-around", display: "flex" }}>

                <th>No</th>
                <th>OUT Time</th> 
                <th>IN Time</th>

            </table>
            <table style={{    justifyContent: "space-around", display: "flex" }}>

                <tr>1</tr>
                <tr>12:00</tr>
                <tr>01:00</tr> 

            </table>

        </div>
    )
}

export default log;
